(16, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '下班回家，疲惫的推开门，看见儿子在看电视，老公在打游戏。静悄悄地都没有理我，忍不住抱怨：“我是这个家的空气吗？”\n于是，儿子放下遥控器，老公放下手机，他俩一起冲向我摸着肚子说：好饿呀！！！', 1599580800, 1600963200, 1382400, '101', 1, '', '2020-09-14 12:11:21', '2020-09-14 12:11:21', NULL),
(17, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 4, 'A：你的狗做过什么让你感动的事？\nB：把我家猫拉的屎吃了，省得我去丢了~', 1599580800, 1599667200, 86400, '101', 1, '', '2020-09-14 12:11:55', '2020-09-14 12:11:55', NULL),
(18, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '和我妈走大街上，过来一辆洒水车，喷我和我妈一身。我妈随即张口：你这孩子！\n我：洒水车过去你骂我干啥？你骂车啊！干我屁事！\n我妈：就你带的这条路来洒水车！别的路咋都没有？还不怪你！\n我：行吧你开心就好。', 1598900462, 1599105780, 205318, '101', 3, '101', '2020-09-14 12:12:28', '2020-09-14 12:59:41', NULL),
(19, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '42343', 1598976000, 1599062400, 86400, '423', 1, '', '2020-09-14 12:12:52', '2020-09-14 12:12:56', '2020-09-14 12:12:56'),
(20, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 2, '一位内务人民委员部审判员结束一天的审判工作，回到办公室，突然独自大笑起来。\n\n对面办公桌的同事奇怪的问道：“有什么好笑的事吗？”\n\n“是啊，”审判员用手帕擦着笑出来的眼泪：“一个很好笑的笑话……”\n\n“哦？说来听听？”\n\n“你疯了吗？！我刚判了说这笑话的家伙五年苦役！”', 1599580800, 1600272000, 691200, '101', 1, '', '2020-09-14 20:56:11', '2020-09-14 20:56:11', NULL);
