(4, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '朋友们，不要的人民币不要扔，可以来找我换不锈钢脸盆。', 1599062400, '20190001', 1, '', '2020-09-14 12:04:02', '2020-09-14 12:04:02', NULL),
(5, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '很多人就是因为小时候兴趣班上多了，所以长大了没兴趣上班。', 1599667200, '20190001', 2, '101', '2020-09-14 12:10:11', '2020-09-14 13:00:01', NULL),
(6, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '算卦的说我2月会发财，这都农历4月了，我气哄哄去质问为什么卦象不准？\n算卦的说：还不是你们女人爱变卦！', 1600272000, '101', 1, '', '2020-09-14 12:10:33', '2020-09-14 12:10:33', NULL),
(7, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '刚刚我去理发店剪头发，理发师问我剪到哪，我说剪到下巴，然后他说剪到哪层下巴？', 1598976000, '20190001', 3, '101', '2020-09-14 12:10:59', '2020-09-14 13:00:08', NULL),
(8, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '内务人民委员部的一间牢房里关了三个人，彼此间谈起坐牢的原因。\n\n第一个人说：“我因为反对党委书记彼得罗夫。”\n\n第二个人说：“我因为支持彼得罗夫。”\n\n第三个人说：“我就是彼得罗夫。”', 1599753600, '101', 1, '', '2020-09-14 20:57:05', '2020-09-14 20:57:05', NULL);
INSERT INTO `feedback` (`id`, `uuid`, `category`, `matter`, `exact_date`, `process_status`, `handler`, `create_time`, `update_time`, `delete_time`) VALUES
(1, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 2, '现在的手机、电脑都流行触屏。 \n有位朋友感慨：现在科技发展这么快，说不准哪天电视都触屏了。 \n另外一朋友说：你傻啊！有遥控器不用，非要走过去用手指戳？', 1600185600, 2, '101', '2020-09-13 15:11:16', '2020-09-14 02:57:53', NULL),
(2, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 2, '一位妇女对医生说：“我儿子一直喜欢玩沙子，又是做沙子食品，又是盖沙塔，您觉得他正不正常，要治疗吗？”\n医生说：“这对于一个孩子来说是正常的。”\n妇女：“是呀，我和孩子他爸都这么认为，可是他的妻子认为他不正常，总吵着要离婚。”', 1601395200, 3, '101', '2020-09-13 15:12:57', '2020-09-14 02:58:58', NULL),
(3, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '小时候我爸带我去吃海鲜，我担忧道：“听说吃海鲜会痛风？”\n我爸拍拍我的肩膀安慰我：“放心吧，以咱家的经济实力，永远不会吃到痛风的。”', 1599981222, 1, '未审核', '2020-09-13 15:13:42', '2020-09-14 12:03:28', '2020-09-14 12:03:28'),
(4, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 3, '43432', 1599981347, 1, '', '2020-09-13 15:15:47', '2020-09-13 15:25:46', '2020-09-13 15:25:46'),
(5, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '4324324', 1599062400, 3, '101', '2020-09-13 15:26:04', '2020-09-14 03:00:31', '2020-09-14 03:00:31'),
(6, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 4, '“成年人的世界那有容易二字？”\n“有的，容易胖！”\n\n', 1600056202, 1, '', '2020-09-14 12:03:23', '2020-09-14 12:13:57', '2020-09-14 12:13:57'),
(7, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '别人都在晒幸福、晒车、晒房、晒吃、晒喝、晒玩、晒钱，你呢？你晒什么？？你晒得乌漆麻黑的。。。', 1599580800, 1, '', '2020-09-14 12:14:14', '2020-09-14 12:14:14', NULL),
(8, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '343423432', 1599580800, 1, '', '2020-09-14 12:14:22', '2020-09-14 12:14:25', '2020-09-14 12:14:25'),
(9, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 4, '希望我的朋友们可以开开心心的，永远不会难过和悲伤，爱你是其次，主要是因为我真的不会安慰人。', 1600056876, 2, '101', '2020-09-14 12:14:36', '2020-09-14 12:59:11', NULL),
(10, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '去年过年，媳妇怀孕了，挺着大肚子给妈妈拜年，妈妈非常感动，临走给媳妇1000元压岁钱。\n媳妇摸着肚子问妈妈：“妈妈！你这钱是给我的还是给孩子的呢？”\n妈妈顿时明白了，又从兜里掏出一千元给媳妇：“这是给孩子的！”\n媳妇又说话了：“听医生讲，我怀的是双胞胎！”', 1600056889, 3, '101', '2020-09-14 12:14:49', '2020-09-14 12:59:16', NULL),
(11, 'C37709F9-3915-F59E-82D2-43A6F671CD82', 1, '美国外交代表团到苏联访问，苏修接待官员陪他们参观“建设的伟大成就”，并且得意的说：“到了下一个五年计划，每个苏联家庭都可以拥有一架私人飞机！”\n\n美国人惊讶的问：“ 他们要飞机干什么呢？”\n\n苏修官员说：“当然有用啊……譬如你在莫斯科听说列宁格勒开始供应面包了，你可以马上开飞机赶去排队啊。”\n', 1598889600, 1, '', '2020-09-14 20:57:44', '2020-09-14 20:57:44', NULL);
